import React from "react";
import pokemons from "./data";
import Pokemons2 from "./pokemons2";

class App extends React.Component {
	constructor() {
		super();

		this.teste = this.teste.bind(this);
	}

	teste() {
		return pokemons.map((teste) => console.log(teste.name === "Ekans"));
	}

	render() {
		const final = pokemons;

		return (
			<div>
				<div className="teste2">
					{final
						.filter((poke) => poke.type === "Psychic")
						.map((teste) => (
							<Pokemons2 infos={teste} key={teste.id} />
						))}
				</div>
				<div>
          <button>Psychic</button>
          <button>Psychic</button>
          <button>Psychic</button>
          <button>Psychic</button>
				</div>
			</div>
		);
	}
}
export default App;
